import React from 'react';

const List = ({data}) => {
  return (
   <article>{data.map((person)=>{
     return<div key={person.id} className='person'>
       <img src={person.image}/>
       <div>
          <h4>{data.name}</h4>
          <p>{data.age}</p>
       </div>
     </div>
   })}</article>
  );
};

export default List;
